  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Eastern
  Neck NWR outlines Refuge accomplishments during the 1990 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. The report
  includes a planning section which discusses management planning and research and
  investigations. Refuge administration is outlined; information about personnel,
  youth programs, volunteer programs, funding, and safety is given. Habitat management
  is also covered; subjects include wetlands, forests, croplands, grasslands, fire
  management, pest control, and wilderness and special areas. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  raptors, other migratory birds, game mammals, animal control, marking and bird banding,
  and disease prevention and control. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive programs, hunting, fishing, trapping,
  wildlife observation, other wildlife oriented recreation, picnicking, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment utilization and replacement,
  computer systems, and energy conservation. Items of interest are discussed. Photographs
  and Refuge brochures are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
